from collections import deque

# @param A : string
# @param B : string
# @return a strings
def minWindow(A, B):
    start = 0
    min_len = len(A)+1
    q = defaultdict(int)
    T = defaultdict(int)
    for ch in B:
        T[ch] += 1
    ans = ''
    for i, ch in enumerate(A):
        if ch in T:
            q[ch] += 1
            while (q[ch]>T[ch] or A[start] not in T) and start<=i:
                if A[start] in q:
                    q[A[start]] -= 1
                start += 1
            is_eq = True
            for k in T:
                if q[k]!=T[k]:
                    is_eq = False
                    break
            if is_eq:
                l = i-start+1
                if min_len>l:
                    min_len = l
                    ans = A[start:i+1]
    return ans


